import axios from "axios";

const incr = () => {
  return {
    type: "increment",
  };
};
export default incr;

export const decr = () => (dispatch) => {
  dispatch({
    type: "decrement",
  });
};

export const amount = async () => {
  await axios
    .get("https://run.mocky.io/v3/9d71cb03-a9f9-4d70-bae2-9d3adaa1cfe7")
    .then((res) => console.log("act", res))
    .catch((err) => console.log("error"));
  return {
    type: "amount",
  };
};
